const SUPPRESS_UNKNOWN_CHARS = true;
function numToUHex(val){
	return "U+"+Number(val).toString(16).toUpperCase().padStart(4,"0");
}
function GetUnicodeData(codepoint){
	const placeholder = "undefined";
	let newVal = {"Name":placeholder};
	if(UnicodeGlyphNames[codepoint]){
		newVal.Name = UnicodeGlyphNames[codepoint];
	}
	if(UnihanDefs[codepoint]){
		newVal.Name = UnihanDefs[codepoint];
	}
	if(!SUPPRESS_UNKNOWN_CHARS && (Object.values(newVal).includes(placeholder))){
		console.warn("Unknown character data! "+numToUHex(codepoint));
	}
	return window.structuredClone(newVal);
}
function GetUnicodeBlock(c){
	return UnicodeBlocks.find(a=>a[0][0]<=c&&a[0][1]>=c)?.[1];
}
</script>
<script>
function doProcessing(action){
	document.body.classList.toggle("busy", true);
	const startTime = performance.now();
	requestAnimationFrame(() => {
	requestAnimationFrame(() => {
		action();
		requestAnimationFrame(() => {
		requestAnimationFrame(() => {
			document.body.classList.toggle("busy", false);
			const endTime = performance.now();
			console.log("Since load: " + endTime);
			console.log("Processing time: " + (endTime - startTime));
			
		});
		});
	});
	});
}
const USE_SELECT_OPTION_LIST = Boolean(navigator?.userAgent?.match(/\bMobile\b/i));
window.addEventListener("DOMContentLoaded", function(){
	const toc = document.getElementById("toc");
	const blockSelectList = document.getElementById("displayedBlocks");
	const blockSelectSelect = document.getElementById("displayedBlocksSelect");
	blockSelectSelect.addEventListener("change", setDisplayedBlocksSelect);
	
	if(USE_SELECT_OPTION_LIST){
		document.getElementById("displayedBlocks").style.display = "none";
	}else{
		document.getElementById("displayedBlocksSelect").style.display = "none";
	}
	
	const cdat = document.getElementById("chardataraw");
	window.cdat= cdat;
	const cdatInBlocks = ({});
	let inUnknownBlock = false;
	let unknownBlockId = 0;
	const blockOrder = [];
	[...cdat.querySelectorAll("ch")].forEach(ch=>{
		const c = ch.getAttribute("c");
		const h = ch.getAttribute("h");
		const n = numToUHex(c);
		const u = GetUnicodeData(c);
		let d = ch.getAttribute("d");//TODO add support for character components
		let b = GetUnicodeBlock(c);
		if(!b){
			if(!inUnknownBlock){
				++unknownBlockId;
				inUnknownBlock = true;
			}
			b = "UnknownBlock"+unknownBlockId;
		}else{
			inUnknownBlock = false;
		}
		if(blockOrder.at(-1)!=b){
			if(blockOrder.includes(b)){
				console.warn("Discontinuous block detected! "+b);
				debugger;
			}
			blockOrder.push(b);
		}
		cdatInBlocks[b] ??= [];
		const charboxHTML = `<charbox title="${b}\n${u?.Name}\n${c}\t${n}"><svg viewBox="0 0 100 100"><path d="${d}" /></svg><div><span>${h}</span></div></charbox>`;
		cdatInBlocks[b].push(charboxHTML);
	});
	cdat.innerHTML = "";
	blockOrder.map(a=>[a,cdatInBlocks[a].join("\n")]).forEach(bdat=>{
		const tocLabelLink = document.createElement("a");
		const blockName = bdat[0];
		let blockVisible = !blockName.match(/UnknownBlock|Surrogate|Private Use/);
		if(localStorage){
			const storedVal = localStorage[VisibilityToggleBlockStorageUidStart + blockName];
			if(storedVal != null){
				blockVisible = storedVal == "true" ? true : false;
			}
		}
		let blockRange = UnicodeBlocks.find(a=>a[1]===bdat[0])?.[0];
		const blockRangeString = blockRange ? `[${numToUHex(blockRange[0])} to ${numToUHex(blockRange[1])}] ` : (()=>{
			const matches = bdat[1].match(/U\+[A-Fa-f0-9]{4,}/g);
			return `[${matches[0]} to ${matches.at(-1)}] `;
		})();
		const fullBlockLabelText = blockRangeString + blockName;
		tocLabelLink.href = "#"+blockName;
		tocLabelLink.textContent = fullBlockLabelText;
		toc.appendChild(tocLabelLink);
		
		const contlabel = document.createElement("h3");
		contlabel.className = "charboxcontainerlabel";
		{
			const contlabel_anchor = document.createElement("a");
			contlabel_anchor.href = "#"+blockName;
			contlabel_anchor.id = blockName;
			contlabel_anchor.textContent = fullBlockLabelText;
			contlabel.appendChild(contlabel_anchor);
		}
		const contcont = document.createElement("div");
		contcont.className = "charboxcontainercontainer";
		contcont.dataset.blockName = blockName;
		contcont.appendChild(contlabel);
		
		const cont = document.createElement("div");
		cont.className = "charboxcontainer";
		cont.innerHTML += bdat[1];
		contcont.appendChild(cont);
		if(!blockVisible){
			contcont.style.display = "none";
		}
		cdat.appendChild(contcont);
		
		{
			const blockOption = document.createElement("option");
			blockOption.value = blockName;
			blockOption.textContent = blockName;
			blockOption.selected = blockVisible;
			blockSelectSelect.appendChild(blockOption);
		}
		{
			const blockOptionId = "VisibilityToggleButton-"+blockName;
			const blockOption = document.createElement("input");
			const blockOptionLabel = document.createElement("label");
			const blockOptionGroup = document.createElement("li");
			blockOption.checked = blockVisible;
			blockOption.id = blockOptionId;
			blockOption.setAttribute("type", "checkbox");
			blockOption.dataset.blockName = blockName;
			blockOption.addEventListener("change", blockOptionChangeHandler);
			blockOptionLabel.setAttribute("for", blockOptionId);
			blockOptionLabel.appendChild(blockOption);
			blockOptionLabel.append(blockName);
			blockOptionGroup.appendChild(blockOptionLabel);
			blockSelectList.appendChild(blockOptionGroup);
		}
	});
	cdat.id = "chardata";
	cdat.style.display = "";
});
const VisibilityToggleBlockStorageUidStart = "BlockToggleVis-";
const onBlockOptionChange = (name, isSelected)=>{
	if(localStorage){
		localStorage[VisibilityToggleBlockStorageUidStart + name] = isSelected ? "true" : "false";
	}
}
const blockOptionChangeHandler = (event)=>{
	onBlockOptionChange(event.target.dataset.blockName, event.target.checked);
	document.getElementById("chardata")
			.querySelectorAll("[data-block-name=\""+event.target.dataset.blockName+"\"]")
			.forEach(a=>a.style.display = event.target.checked ? "" : "none");
}
const setDisplayedBlocksSelect = (event)=>{
	const base = document.getElementById("chardata");
	event.target.childNodes.forEach(option=>{
		onBlockOptionChange(option.value, option.selected);
		const displayStr = option.selected ? "" : "none";
		base.querySelectorAll("[data-block-name=\""+option.value+"\"]")
			.forEach(a=>a.style.display = displayStr);
	});
}
window.addEventListener("DOMContentLoaded", function(){
	const charRenderFontSizeScaleElem = document.getElementById("charRenderFontSizeScale");
	charRenderFontSizeScaleElem.addEventListener("change", (event)=>{
		doProcessing(()=>{
			const newSize = Number(charRenderFontSizeScaleElem.value) + "%";
			document.body.style.setProperty("--charrenderfontsize", newSize);
			const valElem = charRenderFontSizeScaleElem.parentElement.querySelector("span.value");
			if(valElem){
				valElem.textContent = newSize;
			}
		});
	});
	charRenderFontSizeScaleElem.addEventListener("input", (event)=>{
		const newSize = Number(charRenderFontSizeScaleElem.value) + "%";
		const valElem = charRenderFontSizeScaleElem.parentElement.querySelector("span.value");
		if(valElem){
			valElem.textContent = newSize;
		}
	});
	charRenderFontSizeScaleElem.dispatchEvent(new Event("change"));
	
	const displayBlocksOptionList = document.getElementById("displayBlocksOptionList");
	document.body.addEventListener("focusin", (event)=>{
		if(!event.target.closest("#"+displayBlocksOptionList.id))
		{
			displayBlocksOptionList.removeAttribute("open");
		}
	});
});

<style>
:root {
				scroll-padding-top: 4lh;

}
body {
	margin: 0.3rem;
	font-variant: text;
}
body.busy, body.busy * {
	cursor: wait !important;
}
#chardata {
	--charbox-grid-gap: 0.25lh;
	--charbox-col-count: 16;
	--charboxcont-margin-inline: 0.3rem;
	
	@supports (grid-template-rows: masonry) {
		display: grid;
		grid-template-rows: masonry;
		grid-template-columns: repeat(auto-fit, calc(
				calc(var(--charbox-col-count) * 1lh)
				+ calc(2 * var(--charboxcont-margin-inline))
				+ calc(
					var(--charbox-grid-gap)
						* calc(var(--charbox-col-count) - 1)
				)
			)
		);
	}
	font-size: var(--charrenderfontsize);
	
	.charboxcontainercontainer {
		margin-block-start: 1rem;
		z-index: 1;
		width: fit-content;
		
		.charboxcontainerlabel {
			margin-block-start: 0;
			margin-block-end: 0.1rem;
			margin-inline: 0.3rem;
			font-weight: bolder;
			font-size: 1.2rem !important;
		}
		.charboxcontainer {
			margin-inline: var(--charboxcont-margin-inline);
			display: grid;
			grid-template-columns: repeat(var(--charbox-col-count), 1fr);
			grid-gap: var(--charbox-grid-gap);
			width: fit-content;
			user-select: none;
			
			& charbox {
				outline: 1px solid currentColor;
				/*set min-width for combining marks*/
				text-align: left;
				display: block;
				position: relative;
				width: 1lh;
				height: 1lh;
				aspect-ratio: 1 / 1;
				
				svg {
					z-index: 3;
					position: absolute;
					top: 0;
					left: 0;
					aspect-ratio: 1 / 1;
				}
				div {
					z-index: 2;
					vertical-align: top;
					display: inline-block;
					
					span {
						outline: 2px solid #F00D;
						line-height: 1lh;
					}
				}
			}
			& charbox[title*="Combining" i] {
				div span {
					margin-inline-start: 0.5lh;
				}
			}
		}
	}
	.charboxcontainercontainer:has(:target) {
		animation-name: blink;
		animation-direction: normal;
		animation-duration: 2s;
		animation-iteration-count: 1;
		animation-timing-function: linear;
		.charboxcontainer {
			outline: 3px solid #FF08;
			outline-offset: 2px;
		}
	}
}
@keyframes blink {
	0% {
		outline:5px solid highlight
	}
	100% {
		outline:0px solid transparent
	}
}
.sticky {
	position: sticky;
	top: 0;
	container-type: scroll-state;
	container-name: sticky-heading;
	left: 0;
	right: 0;
	z-index: 100;
	
	#viewOptions {
		padding-block-start: 1rem;
		padding-block-end: 0.5rem;
		padding-inline: 0.2rem;
		transition: top 1s linear;
		width: fit-content;
		--bgcolor: color-mix(in srgb, Canvas 90%, transparent 10%);
		background-color: var(--bgcolor);
		
		& input[type="range"] {
			vertical-align: middle;
		}
		.gotoTop {
			text-decoration: none;
			margin-inline-end: 0.8rem;
			padding: 0.5rem;
			background-color: var(--bgcolor);
			border: 1px solid CanvasText;
			display: inline-block;
		}
		.gotoTop:hover {
			background-color: color-mix(in srgb, var(--bgcolor) 95%, CanvasText 5%);
		}
	}
	details {
		width: 20em;
		margin: 0.3rem;
		position: relative;
		display: inline-block;
		--border-width: 1px;
		border: var(--border-width) solid currentColor;
		border-radius: 0.2em;
		padding-inline: 0.2rem;
		--padding-block: 0.2rem;
		padding-block: var(--padding-block);
		
		--lineheight: 1lh;
		
		summary {
			/*line-height: var(--lineheight);*/
		}
		#displayedBlocks, #displayedBlocksSelect {
			min-height: 10rlh;
			max-height: 50vh;
			overflow: auto;
			width: inherit;
			margin: 0;
			position: absolute;
			border: 1px solid currentColor;
			top: calc(var(--lineheight) + 2 * var(--padding-block) + 2 * var(--border-width));
			background-color: color-mix(in srgb, Canvas 98%, transparent 2%);
			right: 0;
			left: 0;
			list-style: decimal;
			
			option {
				padding-block: 0;

			li {
				--hover-color: blue;
				--active-color: red;
				label {
					width: 100%;

					background-color: color-mix(in srgb, var(--hover-color) 10%, transparent);

				:active {
					background-color: color-mix(in srgb, var(--active-color) 10%, transparent);
					outline: 1px solid color-mix(in srgb, var(--active-color) 20%, transparent);
				}
			}
		}
	}
}
